import React from 'react'

const Journal = () => {

    return (
        // import NoteContext from '../Context/notes/NoteContext'


        <div> style={{ width: '500px' }}
            <form>
                <div className="mb-3">
                    <label htmlFor="title" name="title" className="form-label">Title</label>
                    <input type="text" className="form-control" name="title" id="title" aria-describedby="emailHelp" required minLength={3} />
                </div>
                <div className="mb-3">
                    <label htmlFor="description" name="description" className="form-label" >Description</label>
                    <input type="text" name="description" className="form-control" id="description"
                        required minLength={5} />
                </div>
                <div className="mb-3">
                    <label className="form-label" name="tag" htmlFor="tag">Tag</label>
                    <input type="text" className="form-control" id="tag" name="tag" />
                </div>
                <button type="submit" className="btn btn-primary" >Add Journal</button>
            </form>

        </div>




        // export default Addnote

    )
}
export default Journal;
